('1073','1','1','This model is placed under a table and is perfect for ensuring a pleasent heat from below, so that you can enjoy lovely summer evenings on the patio with warm legs. This HORTUS patio heater distributes the heat 360 degrees with an infrared Golden Tube with short waves. The patio heater just needs to be connected to a power socket, and it is ready to be used. The model can easily be moved around, so that you can use it on many different places with a power socket nearby. Just connect the power and place the patio heater where you want it under the table. The bottom and top are made of stainless steel with a black tube made of aluminium. There is a buildt-in tilt-proofing, which means that the power is cut off if the heater tilts. The power is re-established when the heater is upright again. Effective Golden Tube heating Golden Tube is the newest technology for patio heaters. The tubes emit short, infrared rays that heat up the surfaces they hit. No energy is wasted on heating up air that is blown away. This way you get maximum heat from the energy used. Cheap and environmentally friendly heating of the patio The high effect and energy utilization is beneficial for both the environment and your wallet, since the cost of use per hour starts at just 1.90 DKK and does not go above 4.35 DKK. The low CO2 emissions puts a minimal burden on the environment compared to a free-standing gas heater that pollutes three times as much.Specifications:â¢ Model: 211-370â¢ Type: Under table modelâ¢ Dimensions: H: 65 cm - Ã: 20 cmâ¢ Materials: Steel, aluminium and plasticâ¢ Tubes: Infrared, Golden Tube with short wavesâ¢ Effect level: 1200 Wâ¢ Power: 230 V - 50 Hz - incl. 180 cm cableâ¢ IP classification: IP55â¢ Approved according to: CE, LVD &amp; EMCâ¢ Area of effect: 3-4 m2 - 4-6 peopleâ¢ Start-up time for full effect: 2 secondsâ¢ Energy utilization: ca. 92 %â¢ Cost of use/hour: ca. 2.64 DKKâ¢ CO2 emissions/hour: ca. 1 kgâ¢ Function time: ca. 7000 hoursâ¢ Use: Indoors and outdoors',NULL,'hortus-patio-heater-under-table-1200-w',NULL,NULL,NULL,'HORTUS Patio heater under table 1200 W',NULL,NULL,NULL,NULL),
